import './App.css';
import Home from './pages/Home';
import Detail from './pages/Detail';
import { BrowserRouter as Router,Route } from 'react-router-dom';

function App() {
  return (
    <Router>
        <Home />
        <Detail />
    </Router>
  );
}

export default App;
